import "./App.css";
import React, { Component } from "react";
import NavBar from "./components/navbar";
import About from "./components/about";

class App extends Component {
  state = {
    link: 0,
  };

  handleAbout = () => {};

  handleWork = () => {};

  handleContact = () => {};

  getClassName = () => {
    let classname = "container-fluid vh-100 d-flex align-items-center";
  };

  render() {
    return (
      <React.Fragment>
        <NavBar
          onAbout={this.handleAbout}
          onWork={this.handleWork}
          onContact={this.handleContact}
        />
        <main className="container-fluid bg-dark text-white vh-100 d-flex align-items-center">
          <About />
        </main>
      </React.Fragment>
    );
  }
}

export default App;
